import { useEffect, useState } from "react"

const UserInfo = ({ setInfoModel, userData }) => {

    const [prolist, setProList] = useState(null)
    const [password, setPassword] = useState(null)

    const handleClick = () => {
        setInfoModel(false)
    }

    function ListItem(project) {
        return (
            <div>
                <h4>Project Title: {project.protitle} </h4>
                <h4>Project Des:{project.prodes}</h4>
            </div>)
    }

    let data = Array.from(userData.project);

    const list = (project) => {

        return (project.map((project) =>

            <ListItem value={project} />
        )
        )
    }

    console.log("dataaaa", userData.project.length)

    return (
        <div className="userInfo-model">
            <div className="close-icon" onClick={handleClick}>âœ–</div>
            <h2>User Information</h2>

            <div><h4 className='info'>University: {userData.university}</h4></div>
            <div><h4 className='info'>Github Link: {userData.githublink}</h4></div>
            <div><h4 className='info'>LinkedIn Link: {userData.linkedinlink}</h4></div>
            <div><h4 className='info'>Year of Experience: {userData.YOE}</h4></div>
            <div><h4 className='info'>Bio: {userData.bio}</h4></div>
            <div><h4 className='info'>{list(data)}</h4></div>
            {/* <div><h3 className='info'>project: {userData.project.map((value) => (value.protitle + " "))}</h3></div> */}

        </div>
    )
}

export default UserInfo
